func (suite *EvmTestSuite) TestExportImport() {
	var genState types.GenesisState
	suite.Require().NotPanics(func() {
		genState = evm.ExportGenesis(suite.ctx, suite.app.EvmKeeper, suite.app.AccountKeeper)
	})

	_ = evm.InitGenesis(suite.ctx, suite.app.EvmKeeper, genState)
}

func (suite *EvmTestSuite) TestContractExportImport() {
	gasLimit := uint64(5000000)
	gasPrice := big.NewInt(1)

	priv, err := crypto.GenerateKey()
	suite.Require().NoError(err, "failed to create key")

	ensFactoryCode := common.FromHex("")
	address := suite.deployContract(ensFactoryCode, 1, gasLimit, gasPrice, priv.ToECDSA())

	var genState types.GenesisState
	suite.Require().NotPanics(func() {
		genState = evm.ExportGenesis(suite.ctx, suite.app.EvmKeeper, suite.app.AccountKeeper)
	})

	// sanity check that contract was deployed
	deployedEnsFactoryCode := common.FromHex("")
	code := suite.app.EvmKeeper.GetCode(suite.ctx, address)
	suite.Require().Equal(deployedEnsFactoryCode, code)

	suite.T().Logf("account address 0x%s", priv.PubKey().Address())
	suite.T().Logf("contract addr 0x%x", address)

	// clear keeper code and re-initialize
	suite.app.EvmKeeper.CommitStateDB.WithContext(suite.ctx).SetCode(address, nil)
	_ = evm.InitGenesis(suite.ctx, suite.app.EvmKeeper, genState)

	resCode := suite.app.EvmKeeper.CommitStateDB.WithContext(suite.ctx).GetCode(address)
	suite.Require().Equal(deployedEnsFactoryCode, resCode)
}

func (suite *EvmTestSuite) deployContract(code []byte, nonce, gasLimit uint64, gasPrice *big.Int, priv *ecdsa.PrivateKey) common.Address {
	tx := types.NewMsgEthereumTx(nonce, nil, big.NewInt(0), gasLimit, gasPrice, code)
	err := tx.Sign(big.NewInt(3), priv)
	suite.Require().NoError(err)

	result, err := suite.handler(suite.ctx, tx)
	suite.Require().NoError(err, "failed to handle eth tx msg")
	resData, err := types.DecodeResultData(result.Data)
	suite.Require().NoError(err)
	return resData.ContractAddress
}

func (suite *EvmTestSuite) call(data []byte, to common.Address, nonce, gasLimit uint64, gasPrice *big.Int, priv *ecdsa.PrivateKey) types.ResultData {
	tx := types.NewMsgEthereumTx(nonce, &to, big.NewInt(0), gasLimit, gasPrice, data)
	err := tx.Sign(big.NewInt(3), priv)
	suite.Require().NoError(err)

	result, err := suite.handler(suite.ctx, tx)
	suite.Require().NoError(err)
	resData, err := types.DecodeResultData(result.Data)
	suite.Require().NoError(err)
	return resData
}

type testData struct {
	name string
	code []byte // non-nil if contract deployment
	to   string
	data []byte
}

func (suite *EvmTestSuite) TestAragonExportImport() {
	// the reason the gas limit is so high is because we are deploying everything in 1 block
	gasLimit := uint64(25000000)
	gasPrice := big.NewInt(1)

	priv, err := crypto.GenerateKey()
	suite.Require().NoError(err, "failed to create key")
	privECDSA := priv.ToECDSA()

	suite.T().Logf("account address 0x%s", priv.PubKey().Address())
	suite.T().Logf("private key 0x%x", priv.Bytes())
	owner := common.BytesToAddress(priv.PubKey().Address())
	suite.app.EvmKeeper.CommitStateDB.WithContext(suite.ctx).SetBalance(owner, big.NewInt(2^32))

	nonce := uint64(1)

	// map of contract name -> address
	contractAddrs := make(map[string]common.Address)

	// map of test name -> return data
	returnData := make(map[string][]byte)

	testCases := []testData{
		{
			name: "ENSFactory",
			code: common.FromHex(""),
		},
		{
			name: "ENS", // calls ENSFactory.newENS
			to:   "ENSFactory",
			data: append(common.FromHex("0xe9358b01"), padAddr(owner)...),
		},
		{
			name: "APMRegistry",
			code: common.FromHex(""),
		},
		{
			name: "Repo",
			code: common.FromHex(""),
		},
		{
			name: "ENSSubdomainRegistrar",
			code: common.FromHex(""),
		},
		{
			name: "Kernel",
			code: common.FromHex(""),
		},
		{
			name: "ACL",
			code: common.FromHex(""),
		},
		{
			name: "EVMScriptRegistryFactory",
			code: common.FromHex(""),
		},
		{
			name: "DAOFactory",
			code: common.FromHex(""),
		},
		{
			name: "APMRegistryFactory",
			code: common.FromHex(""),
		},
		{
			name: "ens.owner",
			to:   "ENS",
			data: common.FromHex("0x02571be39065c3e7f7b7ef1ef4e53d2d0b8e0cef02874ab020c1ece79d5f0d3d0111c0ba"),
		},
		{
			name: "ens.setSubnodeOwner",
			to:   "ENS",
			data: common.FromHex("0x06ab592393cdeb708b7545dc668eb9280176169d1c33cfd8ed6f04690a0bcc88a93fc4ae1542111b4698ac085139692eae7c6efb632a4ae2779f8686da94511ebbbff594"),
		},
		// {
		// 	name: "apmRegistryFactory.newAPM",
		// 	to:   "APMRegistryFactory",
		// 	data: append(common.FromHex("0xaac57b3a93cdeb708b7545dc668eb9280176169d1c33cfd8ed6f04690a0bcc88a93fc4ae1542111b4698ac085139692eae7c6efb632a4ae2779f8686da94511ebbbff594"), padAddr(owner)...),
		// },
	}

	for _, test := range testCases {
		if test.code != nil {
			if test.name == "DAOFactory" {
				test.code = append(test.code, padAddr(contractAddrs["Kernel"])...)
				test.code = append(test.code, padAddr(contractAddrs["ACL"])...)
				test.code = append(test.code, padAddr(contractAddrs["EVMScriptRegistryFactory"])...)
			}

			if test.name == "APMRegistryFactory" {
				test.code = append(test.code, padAddr(contractAddrs["DAOFactory"])...)
				test.code = append(test.code, padAddr(contractAddrs["APMRegistry"])...)
				test.code = append(test.code, padAddr(contractAddrs["Repo"])...)
				test.code = append(test.code, padAddr(contractAddrs["ENSSubdomainRegistrar"])...)
				test.code = append(test.code, padAddr(contractAddrs["ENS"])...)
				test.code = append(test.code, padAddr(contractAddrs["ENSFactory"])...)
			}

			contractAddrs[test.name] = suite.deployContract(test.code, nonce, gasLimit, gasPrice, privECDSA)
			suite.T().Logf("%s address: 0x%x", test.name, contractAddrs[test.name])
		} else {

			// if test.name == "apmRegistryFactory.newAPM" {
			// 	suite.T().Log(test.data)
			// 	suite.T().Log(len(test.data))
			// }

			if test.name == "ens.setSubnodeOwner" {
				test.data = append(test.data, padAddr(contractAddrs["APMRegistryFactory"])...)
			}

			resData := suite.call(test.data, contractAddrs[test.to], nonce, gasLimit, gasPrice, privECDSA)

			returnData[test.name] = resData.Ret
			contractAddrs[test.name] = common.BytesToAddress(resData.Ret)
			suite.T().Logf("%s address: 0x%x", test.name, contractAddrs[test.name])
			suite.T().Logf("%s return: 0x%x", test.name, returnData[test.name])
		}

		nonce += 1
	}

	_, err = suite.app.EvmKeeper.CommitStateDB.Commit(true)
	suite.Require().NoError(err)

	err = suite.app.EvmKeeper.CommitStateDB.Finalise(true)
	suite.Require().NoError(err)

	var genState types.GenesisState
	suite.Require().NotPanics(func() {
		genState = evm.ExportGenesis(suite.ctx, suite.app.EvmKeeper, suite.app.AccountKeeper)
	})

	for _, acc := range genState.Accounts {
		suite.T().Log(acc.Storage)
		if acc.Address == contractAddrs["ENS"] {
			//suite.Require().NotNil(acc.Storage)
		}
	}

	//suite.logJSON(genState)

	for _, test := range testCases {
		if test.code != nil {
			code := suite.app.EvmKeeper.GetCode(suite.ctx, contractAddrs[test.name])
			suite.Require().NotNil(code)

			// clear keeper code
			suite.app.EvmKeeper.CommitStateDB.WithContext(suite.ctx).SetCode(contractAddrs[test.name], nil)
		}

		// TODO: check state updates for contract calls
	}

	_ = evm.InitGenesis(suite.ctx, suite.app.EvmKeeper, genState)

	for _, test := range testCases {
		if test.code != nil {
			code := suite.app.EvmKeeper.GetCode(suite.ctx, contractAddrs[test.name])
			suite.Require().NotNil(code)
			// TODO: check if deployed contract code matches (note: deployed code is different from raw bytecode)
		}

		// TODO: check state updates for contract calls
	}
}

func padAddr(a common.Address) []byte {
	ap := a.Hash()
	return ap[:]
}

func (suite *EvmTestSuite) logJSON(genState types.GenesisState) {
	m, err := json.MarshalIndent(genState, "", "\t")
	suite.Require().NoError(err)
	suite.T().Logf("%s", m)
}

